import '../../css/style.scss';
import Navigation from '../../component/Navigation';
import TokenListing from '../component/TokenListing';
import MainBackground from '../../../shared/images/main-background.png';
import TokenContext from '../../../../contexts/TokenContext';
import { useContext } from 'react';
import TokenTypes from '../../../../enums/TokenType';
import { useTranslation } from 'react-i18next';

const Dashboard = () => {
  const { tokenlist } = useContext(TokenContext);
  const { t } = useTranslation();

  return (
    <div className="elysia--pc">
      <div className={`service`}>
        <section className="main" style={{ backgroundImage: `url(${MainBackground})` }}>
          <Navigation />
          <div className="main__content-container">
            <h1 className="main__content--bold">
              <span className="main__content--blue">{t("main.elyfi")}</span> : <br />{t("main.elyfi-title")}
            </h1>
            <p className="main__content">
              {t("main.elyfi-content")}
            </p>
          </div>
        </section>
        <section className="tokens">
          <TokenListing 
            header={t("app.token")}
            tokenlist={tokenlist.filter((item) => {
              return item.type === TokenTypes.CRYPTO
            })}
          />
          <TokenListing
            header={t("app.asset-token")}
            tokenlist={tokenlist.filter((item) => {
              return item.type === TokenTypes.ASSETS
            })}
          />  
        </section>
      </div>
    </div>
  );
}

export default Dashboard;
